contracts/FettiERC20.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/interfaces/IERC4626.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../node_modules/@openzeppelin/contracts/utils/math/Math.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./IVault.sol";
import "./ILoaner.sol";

//This token represents the amount of dai entered into the system as a lender
//The backing of each token increases as profits are made from the loan
//Is a erc4626 token
contract FettiERC20 is ERC20, IERC4626{
    using Math for uint256;

    event Test(uint256 x, uint256 y);
 
    struct WidthdrawRequest{
        uint256 epocPlaced;
        uint256 daiToSend;
        uint256 liqToBurn;
        address sendTo;
    }

    mapping(address=>WidthdrawRequest) public _requestedWidthdraws;

    uint256 public _currEpoc;
    //shifted 1e18 units. represents (dai earned per gns)
    uint256 public _epocBurnRate; 
    uint256 public _epocStartTime;

    uint256 public _totalRequested;
    uint256 public _epocLength;
    uint256 public _epocWidthdrawWait;
    
    address private _gov;
    IERC20 private immutable _dai;
    IVault private _vault;
    ILoaner private _loaner;

    constructor() ERC20("fetti", "FET"){
        _gov = msg.sender;
        _dai = IERC20(0x8f3Cf7ad23Cd3CaDbD9735AFf958023239c6A063);

        _currEpoc=1;
        _epocBurnRate=0; 
        _epocStartTime=block.timestamp;

        _totalRequested=0;
        _epocLength=60;
        _epocWidthdrawWait=2;
    }

    function _doSync() public returns(uint256){
        if(block.timestamp>=(_epocStartTime+_epocLength)){

            if(totalSupply()==0){
                _epocBurnRate = 0;
            }else{
                _epocBurnRate = (totalAssets()*1e18)/totalSupply();
            }
            _epocStartTime=block.timestamp;
            _currEpoc++;

            uint256 vaultBalance = _dai.balanceOf(address(_vault));
            uint256 loanerBalance = _dai.balanceOf(address(_loaner));

            if(_totalRequested>vaultBalance){
                if(_totalRequested>(vaultBalance+loanerBalance)){
                    _epocWidthdrawWait++;
                    _loaner.sendToVault(loanerBalance);
                    _loaner.setPoolMax(0);
                    return _currEpoc;
                }else{
                    _loaner.sendToVault((_totalRequested-vaultBalance));
                    _loaner.setPoolMax(_dai.balanceOf(address(_loaner)));
                    return _currEpoc;
                }
            }else{
                uint256 daiOverRequest = vaultBalance-_totalRequested;
                if(daiOverRequest>0){
                    _vault.sendDaiToLoaner(daiOverRequest);
                    _loaner.setPoolMax(_dai.balanceOf(address(_loaner)));
                }
                _epocWidthdrawWait=1;
                return _currEpoc;
            }
        } 
        return _currEpoc;   
    }

    /**
     * @param amount_ Amount of LIQGNS (FET in the current repo) to send 
     * @param sendTo_ where the backing dai should be sent to 
     */
    function requestWidthdraw(uint256 amount_, address sendTo_) external {
        require(balanceOf(msg.sender)>=amount_, "don't have enough tokens");
        require(allowance(msg.sender, address(this))>=amount_, "don't have enough tokens approved");
        SafeERC20.safeTransferFrom(IERC20(this), msg.sender, address(this), amount_);
        uint256 assets_ = (amount_*_epocBurnRate)/(1e18);
        _totalRequested+=assets_;
        _requestedWidthdraws[msg.sender]=WidthdrawRequest(_currEpoc, assets_, amount_, sendTo_);
    } 

    //set vault after deployment
    function setVault(address vault_) external returns(IVault vault){
        require(_gov==msg.sender, "Must be the gov!!");
        _vault = IVault(vault_);
        return _vault;
    }

    //set vault after deployment
    function setLoaner(address loaner_)external returns(ILoaner loaner){
        require(_gov==msg.sender, "Must be the gov!!");
        _loaner = ILoaner(loaner_);
        return _loaner;
    }

    function decimals() public pure override(ERC20, IERC20Metadata) returns (uint8) {
        return 18;
    }

    function asset() external view override returns (address assetTokenAddress){
        return address(_dai);
    }

    function totalAssets() public view override(IERC4626) returns (uint256 totalManagedAssets){
        return _vault.totalDai();
    }

    function totalDaiInVault() public view returns (uint256 totalManagedAssets){
        return _vault.totalDaiInVault();
    }

    //changes in called function
    function convertToShares(uint256 assets) external view override returns (uint256 shares){
        return _convertToShares(assets, Math.Rounding.Down);
    }

    //changes in called function
    function convertToAssets(uint256 shares) external view override returns (uint256 assets){
        return _convertToAssets(shares, Math.Rounding.Down);
    }

    //always return max amount possible to deposit
    function maxDeposit(address) public view override returns (uint256 maxAssets){
        return _isVaultCollateralized() ? type(uint256).max : 0;
    }

    //always return max amount possible to deposit
    function maxMint(address) public pure override returns (uint256 maxShares){
        return type(uint256).max;
    }

    function maxWithdraw(address owner) public view override returns (uint256 maxAssets){
        uint256 vaultLiquidity = _vault.totalDaiInVault();
        uint256 addressBalance = _convertToAssets(balanceOf(owner), Math.Rounding.Down);
        if(vaultLiquidity>addressBalance){
            return addressBalance;
        }
        return vaultLiquidity;  
    }

    function maxRedeem(address owner) public view override returns (uint256 maxShares){
        uint256 vaultLiquidity = _convertToShares(_vault.totalDaiInVault(), Math.Rounding.Up);
        uint256 addressBalance = balanceOf(owner);
        if(vaultLiquidity>addressBalance){
            return _convertToShares(addressBalance, Math.Rounding.Down);
        }
        return _convertToShares(vaultLiquidity, Math.Rounding.Down);
    }

    //should be the same
    function previewDeposit(uint256 assets) public view override returns (uint256 shares){
        return _convertToShares(assets, Math.Rounding.Down);
    }

    //should be the same
    function previewMint(uint256 shares) public view override returns (uint256 assets){
        return _convertToAssets(shares, Math.Rounding.Up);
    }

    //return what they would get - vault fee
    function previewWithdraw(uint256 assets) public view override returns (uint256 shares){
        return _convertToShares(assets, Math.Rounding.Up);
    }

    //return what they get - vault fee
    function previewRedeem(uint256 shares) public view override returns (uint256 assets){
        return _convertToAssets(shares, Math.Rounding.Down);
    }

    //changes made in _deposit not here
    //check for deprecation
    //idk what else is needed
    function deposit(uint256 assets, address receiver) external override returns (uint256 shares){
        require(assets <= maxDeposit(receiver), "ERC4626: deposit more than max");
        require(_dai.balanceOf(msg.sender)>=assets, "Not enough assets in the wallet");
        uint256 shares_ = previewDeposit(assets);
        _deposit(_msgSender(), receiver, assets, shares_);
        return shares;
    }

    function mint(uint256 shares, address receiver) external override returns (uint256 assets){
        require(shares <= maxMint(receiver), "ERC4626: mint more than max");

        uint256 asset_ = previewMint(shares);
        _deposit(_msgSender(), receiver, asset_, shares);

        return assets;
    }

    /**
     * need to test
     */
    function withdraw(uint256 assets, address receiver, address owner) external override returns (uint256 shares){
        WidthdrawRequest memory req = _requestedWidthdraws[msg.sender];
        require(req.epocPlaced+_epocWidthdrawWait>=_currEpoc, "No request found or reuqest not withdrawable yet");
        require(_dai.balanceOf(address(this))>assets, "Not enough dai in vault");
        require(balanceOf(address(this))>=req.liqToBurn, "not enough liq in the vault");
        approve(msg.sender,req.daiToSend);
        _withdraw(_msgSender(), receiver, address(this), req.daiToSend, req.liqToBurn);
        return shares;
    }

    function redeem(uint256 shares, address receiver, address owner) external override returns (uint256 assets){
        WidthdrawRequest memory req = _requestedWidthdraws[msg.sender];
        require(req.epocPlaced+_epocWidthdrawWait>=_currEpoc, "No request found or reuqest not withdrawable yet");
        require(_dai.balanceOf(address(this))>assets, "Not enough dai in vault");
        require(balanceOf(address(this))>=req.liqToBurn, "not enough liq in the vault");
        approve(msg.sender,req.daiToSend);
        _withdraw(_msgSender(), receiver, address(this), req.daiToSend, req.liqToBurn);
        return shares;
    }

    //vault.totalAssets() or asset.balanceOf, prob balanceOf
    //also check deprecation
    function _convertToShares(uint256 assets, Math.Rounding rounding) internal view returns (uint256 shares) {
        uint256 supply = totalSupply();
        uint256 totAssets = totalAssets();
        return (assets == 0 || supply == 0) ? _initialConvertToShares(assets, rounding) : assets.mulDiv(supply, totAssets, rounding);
    }

    function _initialConvertToShares(uint256 assets, Math.Rounding) internal pure returns (uint256 shares) {
        return assets;
    }

    //get total assets from the vault or balanceOF(vaultAddy)
    function _convertToAssets(uint256 shares, Math.Rounding rounding) internal view returns (uint256 assets) {
        uint256 supply = totalSupply();
        return (supply == 0) ? _initialConvertToAssets(shares, rounding) : shares.mulDiv(totalAssets(), supply, rounding);
    }

    function _initialConvertToAssets(uint256 shares, Math.Rounding) internal pure returns (uint256 assets) {
        return shares;
    }

    function _isVaultCollateralized() private view returns (bool) {
        return totalAssets() > 0 || totalSupply() == 0;
    }

    //transfer to vault address
    //i think that is the only change, but check again 
    function _deposit(address caller, address receiver, uint256 assets, uint256 shares) internal {
        SafeERC20.safeTransferFrom(_dai, caller, address(_vault), assets);
        _mint(receiver, shares);
        emit Deposit(caller, receiver, assets, shares);
    }

    function _withdraw(address caller, address receiver, address owner, uint256 assets, uint256 shares) internal {
        if (caller != owner) {
            _spendAllowance(owner, caller, shares);
        }
        delete _requestedWidthdraws[msg.sender];
        _totalRequested-=assets;
        _burn(owner, shares);
        _vault.widthdraw(receiver, assets);
        emit Withdraw(caller, receiver, owner, assets, shares);
    }
}

contracts/ILoaner.sol.content:
pragma solidity ^0.8.0;

interface ILoaner{

    function totalDai() external view returns(uint256 amount);
    
    function addPool(address newPool_, uint256 maxBorrow_) external;
    
    function setPoolMax(uint256 newMax_) external;

    function sendLoan(address payable borrower_, uint256 amount_) external returns(uint256);

    function totalLoanedOut() external returns(uint256 amount);

    function poolFreeDai() external returns(uint256);

    function sendToVault(uint256 amount_) external returns(uint256);
}

